function ProjectHeading() {
  return (
    <div className="shadow-lg border-dark card my-2" id="darkTheme">
      <div className="card-body">
        <div className="my-2">
          <div className="">
            <h5 className="textLight">PROJECT</h5>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProjectHeading;
